Bab Amr neighborhood, Homs || February, 6th, 2012 ||  One can see the smoking from shelling the neighborhood and one can hear the sounds of the shelling. 

&lt;a href="http://www.youtube.com/watch?v=M80m0Mj06xA"&gt;http://www.youtube.com/watch?v=M80m0Mj06xA&lt;/a&gt; 
&lt;a href="http://www.youtube.com/watch?v=E1iQcuLPnew"&gt;http://www.youtube.com/watch?v=E1iQcuLPnew&lt;/a&gt; 
Bab Amr neighborhood, Homs || February, 6th, 2012 || One can see many wounded people in a field hospital who were injured while the Syrian army are shelling the neighborhood by tanks and armory. The number of killed people is still unknown.  

&lt;a href="http://www.youtube.com/watch?v=SxmAaXC8eRs"&gt;http://www.youtube.com/watch?v=SxmAaXC8eRs&lt;/a&gt; 
Bab Amr neighborhood, Homs || February, 6th, 2012 || At least two civilians were killed while the Syrian army shelled the field hospital.

